import React from 'react';
import { Header } from '../src/Header';
import { Menu } from '../src/Menu';
import OpenCampaign from './OpenCampaign';
function Home({ campaigns, setCampaigns }) {
  return (
    <div>
      <Header />
      <Menu />

      <div className="container">
        <div className="row">
          <div className="col-12">
            <h2>Home</h2>
          </div>
        </div>
        <div className="row">
          <div className="col-12">
            <OpenCampaign setCampaigns={setCampaigns} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
